import React from "react";
import CarComponents from "./components/CarComponents";

class App2 extends React.Component {
  render() {
    return (
      <div className="cars">
        <CarComponents model="Volvo" spid="160" mass="1300" color="Read" />
        <CarComponents model="Volcwagen" spid="140" mass="1100" color="Black" />
      </div>
    );
  }
}
export default App2;
